var Utils = require('./utils');
var FB_CTF = require('./fb-ctf');
var Admin = require('./admin');

var $ = require('jquery');
require('./plugins');

// Add the transitionend event to a global var
(function(window) {
  var transitions = {
    'transition': 'transitionend',
    'WebkitTransition': 'webkitTransitionEnd',
    'MozTransition': 'transitionend',
    'OTransition': 'otransitionend'
  },
      elem = document.createElement('div');

  for (var t in transitions) {
    if (typeof elem.style[t] !== 'undefined') {
      window.transitionEnd = transitions[t];
      break;
    }
  }
})(window);

function enableNavActiveState() {
  var page = Utils.getURLParameter('page');

  $('.fb-main-nav a').removeClass('active').filter(function() {
    var href = $(this).data('active');

    if (href === undefined || !href.indexOf || page === '') {
      return false;
    }
    return href.indexOf(page) > -1;
  }).addClass('active');
}

function enableAdminActiveState() {
  var page = Utils.getURLParameter('page');

  $('#fb-admin-nav li').removeClass('active').filter(function() {
    var href = $('a', this).attr('href').replace('#', '');

    if (href === undefined || !href.indexOf || page === '') {
      return false;
    }
    return href.indexOf(page) > -1;
  }).addClass('active');
}

function animateSvgStroke(svgElement) {
  if (!svgElement) return;

  const paths = svgElement.querySelectorAll("path");

  if (!document.getElementById("svg-stroke-animation")) {
    const style = document.createElement("style");
    style.id = "svg-stroke-animation";
    style.textContent = `
      @keyframes strokeFlow {
        0% {
          stroke-dashoffset: 2000;
        }
        100% {
          stroke-dashoffset: 0;
        }
      }
      .animated-stroke {
        stroke: url(#stroke-gradient);
        stroke-width: 1.5;
        fill: none;
        stroke-dasharray: 2000;
        animation: strokeFlow 3s ease-out forwards;
      }
      @keyframes gradientShift {
        0% { stop-color: #D8E0EB; }
        50% { stop-color: #BBCADD; }
        100% { stop-color: #D8E0EB; }
      }
      #stroke-gradient stop {
        animation: gradientShift 4s linear infinite;
      }
    `;
    document.head.appendChild(style);
  }

  let defs = svgElement.querySelector("defs");
  if (!defs) {
    defs = document.createElementNS("http://www.w3.org/2000/svg", "defs");
    svgElement.insertBefore(defs, svgElement.firstChild);
  }

  if (!svgElement.querySelector("#stroke-gradient")) {
    const grad = document.createElementNS("http://www.w3.org/2000/svg", "linearGradient");
    grad.id = "stroke-gradient";
    grad.setAttribute("x1", "0%");
    grad.setAttribute("y1", "0%");
    grad.setAttribute("x2", "100%");
    grad.setAttribute("y2", "0%");

    const stop1 = document.createElementNS("http://www.w3.org/2000/svg", "stop");
    stop1.setAttribute("offset", "0%");
    stop1.setAttribute("stop-color", "#BBCADD");
    const stop2 = document.createElementNS("http://www.w3.org/2000/svg", "stop");
    stop2.setAttribute("offset", "100%");
    stop2.setAttribute("stop-color", "#0060B9");

    grad.appendChild(stop1);
    grad.appendChild(stop2);
    defs.appendChild(grad);
  }

  paths.forEach(path => {
    const clone = path.cloneNode();
    clone.classList.add("animated-stroke");
    svgElement.appendChild(clone);
  });
}

